import React, { useState, useEffect } from 'react'
import axios from 'axios'


function PastStats() {
    const [season, setSeason] = useState(null);
    const [seasonType, setSeasonType] = useState(null);

    useEffect( () => {
            if (season && seasonType) {
                axios.get
            }
        }
    )
}
